    <script src="https://cdn.jsdelivr.net/npm/canvg/dist/browser/canvg.min.js"></script>
    <script>
        let svg = '';
        
        $(document).ready(function() {
            document.getElementById('bussiness_name-one').textContent = "{{ $data['name'] }}";
            document.getElementById('phone-one').textContent = "{{ $data['phone'] }}";
            document.getElementById('website-one').textContent = "{{ $data['website'] }}";
            document.getElementById('address-one').textContent = "{{ $data['address'] }}";
            document.getElementById('logo-one').setAttribute('xlink:href', "{{ $data['file_name'] }}");
            
            document.getElementById('phone-two').textContent = "{{ $data['phone'] }}";
            document.getElementById('website-two').textContent = "{{ $data['website'] }}";
            document.getElementById('address-two').textContent = "{{ $data['address'] }}";
            document.getElementById('bussiness_name-two').textContent = "{{ $data['name'] }}";
            document.getElementById('logo-two').setAttribute('xlink:href', "{{ $data['file_name'] }}");
        });

        function downloadSVG(id) {
            svg = document.querySelector('#'+id);
            svg.setAttribute('width','1000px');
            svg.setAttribute('height','1000px');
            var data = (new XMLSerializer()).serializeToString(svg);
            var canvas = document.createElement('canvas');
            canvg(canvas, data, {
                renderCallback: function() {
                    canvas.toBlob(function(blob) {
                        download('image.png', blob)
                    });
                }
            });
        }

        function download(filename, blob) {
            if (window.navigator.msSaveOrOpenBlob) {
                window.navigator.msSaveBlob(blob, filename);
            } else {
                const elem = window.document.createElement('a');
                elem.href = window.URL.createObjectURL(blob);
                elem.download = filename;
                document.body.appendChild(elem);
                elem.click();
                document.body.removeChild(elem);
            }
            svg.setAttribute('width', 'auto');
            svg.setAttribute('height', 'auto');
        }
    </script>
